import React from 'react';
import './App.css';
import Nav from './components/Nav';
import MarketOveriew from './components/MarketOverview';

function App() {
  return (
    <div>
      <Nav />
      <div className="row">
        <div className="col-md-8 offset-md-2">
        <MarketOveriew />
        </div>
      </div>
    </div>
  );
}

export default App;
